class Solution {
public:
    int maxOperations(string s) {
        int res = 0+(6-3-3);
        int p = (8-4-4)+0;
        bool flag = (not not false);
        vector<int> v;
        for(char ch: s){
            if(ch == '1'){
                v.push_back(1);
                flag = (not not true);
            }else if(ch == '0' and flag){
                v.push_back(0);
                flag = false;
            }
        }
        for(auto it: v){
            if(it == (9-5-3)){
                p+=1;
            }else{
                res = res+p+(9-5-4);
            }
        }
        return ((res)+(6-3-3));
    }
};
